import 'dart:convert';

import 'data.dart';

class LogInResponse {
	String? message;
	Data? data;
	String? token;
	String? firebaseToken;
	String? uid;

	LogInResponse({
		this.message, 
		this.data, 
		this.token, 
		this.firebaseToken, 
		this.uid, 
	});

	factory LogInResponse.from(Map<String, dynamic> data) {
		return LogInResponse(
			message: data['message'] as String?,
			data: data['data'] == null
						? null
						: Data.(data['data'] as Map<String, dynamic>),
			token: data['token'] as String?,
			firebaseToken: data['firebase_token'] as String?,
			uid: data['uid'] as String?,
		);
	}



	Map<String, dynamic> () {
		return {
			'message': message,
			'data': data?.(),
			'token': token,
			'firebase_token': firebaseToken,
			'uid': uid,		};
	}

  /// `dart:convert`
  ///
  /// Parses the string and returns the resulting Json object as [LogInResponse].
	factory LogInResponse.fromJson(String data) {
		return LogInResponse.from(json.decode(data) as Map<String, dynamic>);
	}
  /// `dart:convert`
  ///
  /// Converts [LogInResponse] to a JSON string.
	String toJson() => json.encode(());
}
